import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        {/* Left Section: Company Information */}
        <div className="footer-section">
          <h3>About Us</h3>
          <p>Discover the essence of elegance and luxury in our fragrance collections. Explore exclusive offers and premium products.</p>
        </div>

        {/* Middle Section: Links */}
        <div className="footer-section">
          <h3>Quick Links</h3>
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/products">Shop</a></li>
            <li><a href="/contact">Contact Us</a></li>
            <li><a href="/about">About</a></li>
          </ul>
        </div>

        {/* Right Section: Contact & Social Media */}
        <div className="footer-section">
          <h3>Contact Us</h3>
          <p>Email: info@fragranceworld.com</p>
          <p>Phone: +1 234 567 890</p>
          <div className="social-icons">
            <a href="#"><i className="fab fa-facebook"></i></a>
            <a href="#"><i className="fab fa-twitter"></i></a>
            <a href="#"><i className="fab fa-instagram"></i></a>
            <a href="#"><i className="fab fa-linkedin"></i></a>
          </div>
        </div>
      </div>

      {/* Copyright Section */}
      <div className="footer-bottom">
        <p>&copy; 2024 Fragrance World. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
